import React, { useState, useEffect } from "react";

function Valikot(props) {
  const lisaaPaikat = () => {
    let maakunnat = [];
    /* for (let i of props) {
      maakunnat.push(i, props[i]);
    } */
    console.log("prop 1: ", props);
    maakunnat.map((paikka) => {
      console.log("Paikka:", paikka.maakunta);
      return <option value={paikka.maakunta}></option>;
    });
  };

  return (
    <div>
      <select>{lisaaPaikat()}</select>
    </div>
  );
}

export default Valikot;
